import React from 'react';
import { Card, Button } from 'antd';

const PostCard = () => {
    return (
        <div>
            <Card>
                <Image />
                <Content />
                <Button></Button>
            </Card>
            <CommentForm />
            <Comments />
        </div>
    );
};

export default PostCard;
